import React from "react";

function GroupBox() {
  return (
    <span class="group-box col-lg-4">
      <img
        class="img-fluid rounded mb-4 mb-lg-0"
        src="http://placehold.it/270x170"
        alt=""
      />
      <h1>Group Name</h1>
    </span>
  );
}

export default GroupBox;
